I’m excited to announce our new project, @seoulsalon.nyc launching in March here in NYC! 

@seoulsalon.nyc was inspired from ‘the salons’ which blossomed arts and culture through the gathering of diverse minds across creative communities. it has been an idea a few years in the making. 

@seoulsalon.nyc is our reimagining  of this salon culture in NYC, representing modern Seoul through the ’술집 sool jib‘. Hope to share a drink and conversation with you soon there.
